import React from "react";

class UploadSong extends React.Component {
  state = {};
  boxStyle = {
    position: "relative",
    width: "872px",
    height: "629px",
    background: "#050516"
  };
  innerBoxStyle = {};
  render() {
    return;
    <div style={this.boxStyle}>
      <div style={innerBoxStyle}>UploadSong</div>
    </div>;
  }
}

export default UploadSong;
